Erklæring frå lege om tilstanden til den sjuke eller sjuke personen som er under verje for han eller henne.
a) den sjuke eller sjuke personen er under verje for han eller henne;
b) den sjuke eller sjuke personen er under verje for han eller henne og det er grunn til å tru at han eller ho ikkje er i stand til å ta hand om sine eigne interesser;
c) den sjuke eller sjuke personen er under verje for han eller henne og det er grunn til å tru at han eller ho ikkje er i stand til å ta hand om sine eigne interesser på grunn av sinnsliding, demens eller psykisk utviklingshemming;
d) den sjuke eller sjuke personen er under verje for han eller henne og det er grunn til å tru at han eller ho ikkje er i stand til å ta hand om sine eigne interesser på grunn av sinnsliding, demens eller psykisk utviklingshemming og det ikkje er sett opp verje etter § 21 andre ledd eller § 22 første ledd.
